import React, {useState} from 'react'
import Soobchenie from "./Soobchenie";

export default function Dialog({yourmessage}) {
    const [flag, setFlag] = useState(false);
    const [flag2, setFlag2] = useState(false);
    const [flag3, setFlag3] = useState(false);
    const [valutate, setValutate] = useState('');
    const [banker, setBank] = useState('');

    const [message, setMessage] = useState('');
    const [submittedMessage, setSubmittedMessage] = useState('');
    const handleSubmit = async (event) => {
        event.preventDefault();
        setSubmittedMessage(message);
        setMessage('');
    };

    function comissia() {
        if (flag) {
            console.log('Уже нажато');
        } else {
            setFlag(true);
        }
    }

    function valuta(valida) {
        if (flag2) {
            console.log('Uses');
        } else {
            setValutate(valida);
            setFlag2(true);
        }
    }

    function bank(bankik) {
        if (flag3) {
            console.log('Bank');
        } else {
            setBank(bankik)
            setFlag3(true);
        }

    }

    return (
        <>
            <div className={'chat-container'}>
                <Soobchenie message={message} setMessage={setMessage} handleSubmit={handleSubmit}/>
                <div className={'user'}>
                    <p>{yourmessage}</p>
                </div>
                <div className={'bot'}>
                    <p>Привет дорогой пользователь ты очень крут <br/> пожалуйста выбери одну из этих кнопочек</p>
                    <button onClick={comissia}>Коммисия</button>
                    <button>Обмен валюты</button>
                    <button>Че то еще</button>
                </div>
                {flag ? <>
                        <div className={'user'}>Рассчитай комиссию</div>
                        <div className={'bot'}>
                            <p>Выбери валюту</p>
                            <button onClick={() => valuta('Рубли')}>Рубли</button>
                            <button onClick={() => valuta('Евро')}>Евро</button>
                            <button onClick={() => valuta('Доллары')}>Доллары</button>


                        </div>

                    </>
                    : null}
                {flag2 ? <>
                        <div className={'user'}>{valutate}</div>
                        <div className={'bot'}>Напиши сумму которую ты хочешь перевести</div>
                        <div className={'user'}>{submittedMessage}</div>
                    </>
                    : null}
                {submittedMessage.trim() ?
                    <>
                     {!isNaN(submittedMessage) && isFinite(submittedMessage) ?
                         <>
                             <div className={'bot'}>
                                 <p>Выбери банк</p>
                                 <button onClick={() => bank('Сбербанк')}>Сбербанк</button>
                                 <button onClick={() => bank('Т-банк')}>Т-банк</button>
                                 <button onClick={() => bank('Совкомбанк')}>Совкомбанк</button>
                             </div>
                         </>
                         : <div className="bot">
                             <span>Ты ввел не число</span>
                         </div>

                     }
                    </>
                    : null

                }
                {flag3 ?
                    <>
                        <div className={'user'}>{banker}</div>
                    </> : null
                }

            </div>


        </>


    )
}
